window.bookSummaryJSON = "<p>The end is approaching.... Can Jack West unravel the ancient secrets of the Five Greatest Warriors and save the world? </p> <p>With the end of the world fast approaching, Jack West Jnr must rebuild the final pieces of the fabled ancient Machine - the only thing that can prevent global catastrophe. But he is out of clues, out of leads...until he is presented with an ancient text about five unnamed warriors, great historical figures who were all in some way connected to the mysterious Machine. And so Jack and his loyal team set out to discover their identities - and their secrets. </p> <p>Soon Jack is on the trail of a legendary list of greats, from Moses to Genghis Khan and Napoleon, and finally to one most unlikely warrior: the unknown Fifth, who, it is said, will be there at the end of all things. </p>"; 
